import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../cssfile/Mypage.css';

function Mypage() {
  const [user, setUser] = useState(null);
  const [isEdit, setIsEdit] = useState(false);
  const [updatedUser, setUpdatedUser] = useState({
    email: '',
    username: '',
    password: '',
  });
  const [cartItems, setCartItems] = useState([]);

  useEffect(() => {
    const userId = localStorage.getItem('userId');
    if (userId) {
      axios.get(`http://localhost:8080/api/user/${userId}`)
        .then(response => {
          setUser(response.data);
          setUpdatedUser({
            email: response.data.email,
            username: response.data.username,
            password: '',
          });

          axios.get(`http://localhost:8080/api/cart/${userId}`)
            .then(cartResponse => {
              setCartItems(cartResponse.data);
            })
            .catch(error => console.error('Error fetching cart data:', error));
        })
        .catch(error => console.error('Error fetching user data:', error));
    }
  }, []);

  const handleEditClick = () => setIsEdit(true);

  const handleChange = (e) => {
    setUpdatedUser({ ...updatedUser, [e.target.name]: e.target.value });
  };

  const handleSave = () => {
    const userId = localStorage.getItem('userId');
    axios.put(`http://localhost:8080/api/user/${userId}`, updatedUser)
      .then(response => {
        setUser(response.data);
        setIsEdit(false);
      })
      .catch(error => console.error('Error updating user data:', error));
  };

  const handleCancel = () => setIsEdit(false);

  const handleDelete = () => {
    const userId = localStorage.getItem('userId');
    axios.delete(`http://localhost:8080/api/user/${userId}`)
      .then(() => {
        localStorage.removeItem('userId');
        window.location.href = "/login";
      })
      .catch(error => console.error('Error deleting user:', error));
  };

  const handleRemoveItem = (productId) => {
    const userId = localStorage.getItem('userId');
    axios.delete(`http://localhost:8080/api/cart/${userId}/${productId}`)
      .then(() => setCartItems(cartItems.filter(item => item.productid !== productId)))
      .catch(error => console.error('Error removing item from cart:', error));
  };

  return (
    <div className="mypage-container">
      {user && (
        <div>
          <h2>사용자 정보</h2>
          <div>
            <h3>회원 정보 수정</h3>
            <p>이메일: {isEdit ? <input type="email" name="email" value={updatedUser.email} onChange={handleChange} /> : user.email}</p>
            <p>사용자명: {isEdit ? <input type="text" name="username" value={updatedUser.username} onChange={handleChange} /> : user.username}</p>
            <p>비밀번호: {isEdit ? <input type="password" name="password" value={updatedUser.password} onChange={handleChange} /> : '********'}</p>
            <p>가입일: {user.createAt}</p>
            <button onClick={isEdit ? handleSave : handleEditClick}>
              {isEdit ? '저장' : '수정'}
            </button>
            {isEdit && <button onClick={handleCancel}>취소</button>}
          </div>
          <h3>장바구니</h3>
          <ul>
            {cartItems.length > 0 ? cartItems.map(item => (
              <li key={item.productid}>
                {item.product_description} - {item.quantity}개
                <button onClick={() => handleRemoveItem(item.productid)}>삭제</button>
              </li>
            )) : <p>장바구니가 비어 있습니다.</p>}
          </ul>
          <button onClick={handleDelete}>계정 삭제</button>
        </div>
      )}
    </div>
  );
}

export default Mypage;
